window.bookSummaryJSON = "<p><b>Two strangers. Six nights exploring their deepest, darkest fantasies.</b> </p> <p>Whatever he wants, she’ll try. <br> Whatever she wants, he’ll submit.<br> Nick’s not looking for commitment. A few weeks with a woman and then he’s ready to move on. <br> Sarah can’t get past the death of her fiancé but she’s lonely. She misses the feel of a man surrounding her, filling her.<br> A contract. <br> Six nights of physical intimacy. <br> Nothing more. Nothing less. Simple. Uncomplicated. Fun.<br> But she didn’t expect Nick to be sweet and sexy and he never expected to want more. <br> When the contract is over will either of them be able to walk away? <br> <br> <i>A new adult erotic romance that’s filled with second chances, kinky sex, and raw emotions of two damaged people finding each other and learning that life is worth taking a chance.</i></p>"; 
